const store = {
  lib: {
    toasts: {
      connection: newToast('#connectionToast', !1),
      resErr: newToast('#responseErrorToast'),
      resSuc: newToast('#responseSuccessToast')
    }
  }
};
const getStore = (o = 'pwa', e = window.localStorage.getItem(o)) =>
  e ? JSON.parse(e) : {};
const setStore = (o, e = 'pwa', t = getStore) => {
  const s = t();
  localStorage.setItem(e, JSON.stringify({ ...s, ...o })), console.log(t());
};
